import React from 'react';
import Link from 'next/link'

import {Head, Logo} from './styles'

const Header = () => {
  return (
    <Head>
      <Link href="/">
        <Logo>
          <img src="./images/logo.png" />
        </Logo>
      </Link>
      <nav>
        <ul>
          <li>
            <Link href="">
              <a>about</a>
            </Link>
          </li>
        </ul>
      </nav>
    </Head>
  );
};



export default Header;
